import React, { Component } from 'react';
import { getBiggerThumbnailUrl } from '../../helpers/tools';
import 'materialize-css/dist/css/materialize.min.css';
import './card.css';

class Card extends Component {
    render() {
        const image = getBiggerThumbnailUrl(this.props.model.thumbnails);
        return (
            <div className="col s12 m4 l3">
                <div className="card">
                    <div className="card-image">
                        <img
                            onError="https://media.sketchfab.com/thumbnails/4c57687b657445e1b46c83b35e494ad4/1024.jpg"
                            src={image ? image : "https://media.sketchfab.com/thumbnails/4c57687b657445e1b46c83b35e494ad4/1024.jpg"}
                            alt="Model print"></img>
                        <span className="card-title">{this.props.model.name}</span>
                    </div>
                    <div className="card-content">
                        <p>{this.props.model.description}</p>
                    </div>
                    <div className="card-action">
                        <button className="waves-effect waves-light btn" onClick={ this.props.showModelDetails.bind(this, this.props.model) }>See more</button>
                    </div>
                </div>
            </div>
        );
    }
}

export default Card;
